import React from "react";
import Card from "react-bootstrap/Card";
import img1 from "./images/novice.png";
import Button from 'react-bootstrap/Button';




function Cards() {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img variant="top" src={img1} />
      <Card.Body>
        <Card.Title>Novice</Card.Title>
        <Card.Text>
          Nosedive into the world of Computing with our entry level products.
        </Card.Text>
        <Button Link to ='/novice' variant="primary">Go somewhere</Button>
        
      </Card.Body>
    </Card>
  );
}

export default Cards;
